{"mac":"// Place your key bindings in this file to override the defaultsauto[]
[
    {
        "key": "ctrl+shift+cmd+r",
        "command": "extension.newAREPLSession",
        "when": "!inQuickOpen && !terminalFocus"
    },
    {
        "key": "shift+cmd+r",
        "command": "-extension.newAREPLSession",
        "when": "!inQuickOpen && !terminalFocus"
    },
    {
        "key": "shift+alt+r",
        "command": "workbench.action.showAllSymbols"
    },
    {
        "key": "shift+cmd+r",
        "command": "-workbench.action.showAllSymbols"
    },
    {
        "key": "ctrl+shift+alt+r",
        "command": "extension.newlivecodeSession",
        "when": "!inQuickOpen && !terminalFocus"
    },
    {
        "key": "shift+cmd+r",
        "command": "-extension.newlivecodeSession",
        "when": "!inQuickOpen && !terminalFocus"
    },
    {
        "key": "ctrl+cmd+r",
        "command": "rerunSearchEditorSearch",
        "when": "inSearchEditor"
    },
    {
        "key": "shift+cmd+r",
        "command": "-rerunSearchEditorSearch",
        "when": "inSearchEditor"
    },
    {
        "key": "shift+cmd+r",
        "command": "code-runner.run"
    },
    {
        "key": "ctrl+alt+n",
        "command": "-code-runner.run"
    }
]
"}
